    [],nt"revision_timestamp": "2016-07-27T22:21:12.961949",nt"name": "ruby-lake-national-wildlife-refuge-ruby-valley-nevada-1994-annual-water-management-report-",nt"isopen":
    false,nt"url": null,nt"notes": "The water availability forecast for 1995
    may be encouraging for this year, but is again discouraging for the long term recovery
    of refuge wetlands to objective elevations. Refuge wetlands will continue to be
    negatively impacted because of the present low water elevations, lack of stored
    ground water, and current below average snow pack water content. The 1994-95 winter
    snow pack water content, for the period from 1 January to 1 April, is below average
    at 86.7 percent, according to SCS surveys. The actual quantity of water provided
    by the snow pack may be underestimated because much of the snow melted during February
    and the first half of March due to above average temperatures. It is expected that
    there will be an adequate amount of water to maintain the small marsh units at or
    near desired management elevations. It is also expected that there will not be sufficient
    water available to achieve or maintain desired water management elevations in the
    North, East, and South Sumps during 1995. At present, the water elevation in the
    South Sump at the Main Boat Landing (5963.54 ft.) is 9.1 in higher than in 1994
    (5962. 78 ft.) at this same time. Considering that much of the snow pack remains
    on the mountains because of below average ambient air temperatures and that the
    present elevation of the South Sump is higher than in 1994, it is highly likely
    that the maximum elevation of the South Sump in 1995 will exceed the maximum elevation
    in 1994.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
